import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Home from '../Components/home';
import Login from '../Components/login';
import Myaccount from '../Components/my_account';
import ProductDetail from '../Components/product/ProductDetail';
import ProductPage from '../Components/product/productPage';
import { Provider } from 'react-redux';
import Store from '../redux/store';
import Header from '../Components/header';
import Footer from '../Components/footer';
// import axios from 'axios';
class App extends React.Component {
  constructor(props){  
    super(props);
    this.state = {  
      data: JSON.parse(localStorage.getItem('userData')),
      addressData: {}
    }
  }
  render(){
    return (
      <Provider store={Store}>
        <Header data={this.state.data} headerTheam="header" />
        <Router>
          <Routes>
            <Route exact path="/" element={<Home />} />
            <Route exact path="/shop" element={<Home />} />
            <Route exact path="/products" element={<ProductPage />}/>
            <Route exact path="/xproducts/:productId" element={<ProductDetail />}/>
            <Route exact path="/pages" element={<Home />} />
            <Route exact path="/blog" element={<Home />} />
            <Route exact path="/elements" element={<Home />} />
            <Route path="/my_account" element={ <Myaccount/>} />
            <Route path="/login" element={ <Login />} />
          </Routes>
        </Router>
        <Footer />
      </Provider>
    );
  }
}

export default App;
